import React, { Component } from 'react';
import { Navigation } from './Navigation';
import './App.css';

class App extends Component {
constructor() {
  super();
  this.state = {
    route: 'home',
  }
  }

onRouteChange = (route) => {
  this.setState({route: route});
}


  render() {
    const { route } = this.state;

  return (
    <div className="App">
    <Navigation onRouteChange={this.onRouteChange}/>
      {this.state.route === 'home' ?
        <div>
        <h1>William Cragg</h1>
        <h2>Full Stack Developer</h2>
        </div>
        : ( route === 'bio' ? <div>
          <h2>About Me</h2><p>
          Hard-working team player motivated by technology's capacity to accelerate social and environmental change. Strong qualitative and quantitative research tool-set. Physicist with diverse experience in software design and full stack development. Mostly using Python and React.</p>
          <h2>Tools & Technical Skills</h2><p>React, Python, Swift, Data Analysis, AWS, Smart Contracts, Machine Learning</p>
          <h2>Interests</h2><p>Federeated Learning, Baysian Inference, Data Fusion, DLTs, Generative Art, Multi-Agent Systems</p>
          </div> 
        : ( route === 'portfolio' ? <div><p>portfolio</p></div> 
        : ( route === 'contact' ? <div><p>contact</p></div> : <div><p>home</p></div> 
        )))
      }
      </div>
  );
}
}


export default App;
